import "./chart.css"
import React, { PureComponent } from 'react';
import {
    LineChart,
    Line,
    XAxis,
    CartesianGrid,
    Tooltip,
    ResponsiveContainer,
  } from "recharts";

  
export default function Chart() {
    
  return (
    <div className="chart">
      <h3 className="chartTitle">Sales Analytics</h3>
      <ResponsiveContainer width="100%" aspect={4/ 1}></ResponsiveContainer>
    </div>
  );
}
